import Dashboard from 'pages/dashboard';
import Survey from 'pages/survey-analytics';
import CreateSurvey from 'pages/create-survey';

const router = [
  {
    name: "Dashboard",
    path: "/",
    component: () => <Dashboard />
  },

  {
    name: "Survery",
    path: "/surveys/new",
    component: () => <CreateSurvey />
  },

  {
    name: "Survery",
    path: "/survey/:id",
    component: () => <Survey />
  },
];

export default router;
